window.bookSummaryJSON = "<p><b>Two reformed scoundrels have renounced the battlefields and scandals for one another, but their troubled pasts could destroy everything they hold dear…</b></p> <p><i>New York, 1925</i></p> <p>Cranky and jaded Lord Fine—Wesley, now, to the kind-hearted lover he cynically doubts life will let him keep—arrives in Manhattan with one goal: find the American paranormals and get their help with the relic burdening Sebastian. His plans are upended when the other paranormals seem to have vanished, and a mysterious letter warns Wesley that he’s in danger.</p> <p>Sebastian has no doubts when it comes to his feelings for Wesley, but he’s still haunted by the time he spent enthralled by blood magic right here in New York. And now, his magic is unstable, bolstered by a relic that seems to drain energy from his very blood. But there is a threat to Wesley, and Sebastian needs control of his magic to protect him—even if former Great War captain Wesley wants Sebastian to rely on <i>him</i> for a change.</p> <p>Chasing a trail that leads from Fifth Avenue’s bootleggers to a Halloween masquerade at a Tarrytown mansion, they must race to find their friends before devastation is unleashed on New York—and on magic everywhere.</p> <p><b>Roaring Twenties Magic</b></p> <p><b>Book 1: </b><b><i>Proper Scoundrels</i></b></p> <p><b>Book 2: </b><b><i>Once a Rogue</i></b></p>"; 
